In Java, integers were signed variables which used the two's complement interpretation. This meant that variables could hold values from \(-2^{n-1} \) to \(2^{n-1} -1\) where \(n\) is given by the variable type. Integer Types size byte 8 bits short 16 bits int 32 bits long 64 bits In C, variables can be declared as either signed or unsigned. This means that any variable declared as unsigned can hold values from \(0\) to \(2^n -1\) and variables declared as signed can hold values from \(-2^{n-1}\) to \(2^{n -1}-1\). [1] The \(n\), like in Java, is given by the variable type. A typical 64-bit machine will have variable sizes as such: Integer Types size char 8 bits short int 16 bits int 32 bits long int 64 bits However, these sizes are architecture-dependent and can vary from machine to machine. As such, the C standard library provides constants which can help define the ranges of each variables. #include <limits.h> // for INT_MAX, UNIT_MAX
#include <stdio.h> // for printf()
int main()
{ printf("%d", INT_MAX); // prints 2147483647 printf("%d", UINT_MAX); // prints 4294967295 return 0;
} Additionally, the sizeof operator (built in to C) allows us the ability to programmatically obtain the byte size of data. #include <stdio.h> // for printf()
int main()
{ printf("%d", sizeof(int)); // prints 4 (= 32b) on a typical 64-bit machine long long_var = 0; printf("%d", sizeof(long_var)); // prints 8 (= 64b) on a typical 64-bit machine return 0;
}

