In C, like in many other programming languages, we can cast [2] variables to another type. In addition, C lets us move a value from an unsigned integer variable to a signed integer variable (and vice versa). int sx, sy;
unsigned ux, uy;
sx = (int) ux;
uy = (unsigned) sy; When we cast a variable from signed to unsigned (or unsigned to signed), the underlying bit pattern is not changed, but the interpretation of the bit pattern is. This becomes troublesome when a cast results in a interpretation that is not valid. Even if the resulting interpretation is invalid, your program will still cast anyway. This is called coercion . #include <stdio.h>
#include <limits.h>
int main()
{ int i = -1; unsigned u = (unsigned) i; printf("i=%d, u=%u\n", i, u); return 0;
} // Output: i=-1, u=4294967295 Since C ignore the obvious invalid operations this is sometimes referred to as "weak" typing. [3] In addition to the explicit casts (like the one above), we can also implicitly cast between variables through assignments and procedure calls: sx = ux;
uy= sy;
int (fun unsigned u);
uy = fun(sx); By default, integer literals (constants) are considered to be signed integers . If we were to explicitly force them to be unsigned, we can suffix a "U" or "u" to the literal like: 0U, 4294967259u. Lastly, when we mix an unsigned and signed variable in a single expression (including comparison operators), signed values are implicitly cast to unsigned values. [1] Two's complement is not strictly mandated by the C language. However, most machines use it to store and represent signed integers. [2] Moving values between different type is called casting . [3] The strong/weak terminology has had very fragile definitions over the years and are arguably useless in our context. Hence, we will ignore them.

