It’s traditional when learning a new language to write a little program that prints the text Hello, world! to the screen, so we’ll do the same here. Because C maintains a low-level access to hardware, some of its details (like the size of an int) is hardware dependent. For this course, we will be using a 64-bit machine running the latest version of Linux to run, compile, and test all code. For compilation, we will use gcc or the GNU compiler collection. We'll start by making a new source file called hello.c (C source files end with the .c extension). Now, open the hello.c and enter the code below: // File includes must states at the top of the file
#include <stdio.h>
int main(void)
{ printf("Hello, World!\n"); return 0;
} Save the file and open the terminal in the working directory. On the terminal, enter the following commands to compile and run the file: $ gcc -Wall hello.c -o hello
$ ./hello
Hello, World!

