In a C program, the two main parts of program is code (also called text ) and data . Effective memory management is to figure out how to lay these two components onto memory. Let's look at an example program: int my_static_var = 1;
int factorial(int n)
{ if (n <= 1) return my_static_var; return n * factorial(n - 1);
}
void main(void)
{ factorial(5);
} Alt text The two lines that are inside the factorial function and the line that is inside the main function are the code. // from factorial(int n)
if (n <= 1) return my_static_var;
return n * factorial(n - 1); // from main(void)
factorial(5); The code has a few known properties: The code is not likely to change during run-time. [1] The code must be loaded into RAM before a program can begin to execute. The very first line of our program is called static data . int my_static_var = 1; Static data is often overlooked, but very useful component of data. Static data (or static variables) lives outside of any function in our program, and can be accessed by any of them. Static data also has some properties which are: Contrary to its name, it can change The variable's size is fixed Static data must be loaded into RAM before a program can begin to execute. Lastly, the stack is a space for temporary dynamic data. The stack holds temporary variables and function arguments like: /*int factorial(*/ int n //)
